import "./App.css";
import Header from "./Header";
import Leftpanal from "./components/";
import Rightpanal from "./components/Rightpanal/Right";
import Futher from "./components/Futherpanal/futher";
function App() {
  return (
    <div className="App">
      <Header />
      <div className="rightleft">
        <Leftpanal />
        <Rightpanal />
      </div>
      <div className="ter">
        <Futher/>
      </div>
    </div>
  );
}

export default App;
